import React from 'react';
import Footer from '../src/components/footer/Footer';


const App = () => {
  return (
    <div>
        <div>{dummyData.map((data, index) => (
        <Card
          key={index}
          username={data.username}
          date={data.date}
          text={data.text}
        />
      ))}</div>
        <Footer/>
    </div>
  )
}

export default App;
